# ╔═╡ b62ff2a5-4475-43a0-8cc1-3096775405b0
md"""
# JuliaSim
**JuliaSim** is a suite of modeling and simulation tools building on top of the SciML and JuliaControl ecosystems.

**JuliaSim Control** specializes in
- Model Predictive Control
    - Linear
    - Nonlinear
    - Robust
    - Surrogates (nonlinear explicit MPC)
- Optimization-based tuning
- Integration with **ModelingToolkit**
- Integration with JuliaSim **ModelOptimizer**
![JSC](https://user-images.githubusercontent.com/3797491/223356882-526a38a7-9b08-405e-8fba-d5acfd840de2.png)
"""

# ╔═╡ 02d652db-9744-444f-8404-9d3011f094e8
md"""
# Robust MPC for uncertain systems

- What is Model-Predictive Control (MPC)?
- What is an uncertain system?
- What is a robust MPC controller?

**Example:**
```math
P(s) = k\dfrac{1}{s} : \; k ∈ \left\{ 0.5, 1, 5\right\}
```

![Prediction with uncertain parameters](https://user-images.githubusercontent.com/3797491/223052339-123de587-1526-4793-95b1-0ff220b13c76.png)
"""

# ╔═╡ 88628551-f71a-4106-89b5-b0fc0667349a
md"""
## Closing the loop
Solve the optimization problem repeatedly, each time a new measurement arrives
"""

# ╔═╡ 722ad574-c03a-4efc-947f-256182747092
Show(MIME"text/html"(), """<img src="data:image/gif;base64,">""")

# ╔═╡ 88daa49d-b940-478a-b26e-403163c7251c
md"""
# Loading packages
"""

# ╔═╡ 119c6441-9e8e-4436-9508-b9def56302d3
md"""
# Defining the system model

Continuously stirred tank reactor (CSTR)
![CSTR](https://upload.wikimedia.org/wikipedia/commons/thumb/b/be/Agitated_vessel.svg/510px-Agitated_vessel.svg.png)

- 4 states and 2 inputs
- ``C_A \rightarrow C_B`` is exothermic, a higher reactor temperature ``T_r`` causes an increased reaction rate.
- Control the steady-state concentration of one of reactant ``C_B``. 
- **Control inputs**:  feed ``F`` of reactant ``A``, and the heat flow ``Q̇`` from the cooling jacket.
"""

# ╔═╡ be5c726a-3d69-4714-bddd-e9b4a3603ffb
sys = JuliaSimControl.ControlDemoSystems.cstr(); sys.sys

# ╔═╡ aa69cf3d-0094-4594-9e4a-3dfc1bfe3cc2
md"""
## Defining system properties
"""

# ╔═╡ ca13dd0f-50df-4dd7-99cf-00baaf5647d1
begin
	dynamics = sys.dynamics
	nu  = dynamics.nu             # Number of control inputs
	nx  = dynamics.nx             # Number of state variables
	Ts  = sys.Ts                  # Sample time (18 seconds)
	x0  = [0.8, 0.5, 134, 130]    # Initial state
	r   = SA[NaN, 0.6, NaN, NaN]  # State reference 
	N   = 20                      # MPC prediction horizon
end;

# ╔═╡ f7d574b9-c915-45f2-9e3e-faf600555f1b
md"Numerical scaling:"

# ╔═╡ 8ff32240-7286-47b0-b7d5-38e76d518f82
begin
	scale_x = [1, 1, 100, 100] # A rough estimate of the scale of x
	scale_u = [100, 2000]
end

# ╔═╡ 8579d912-7163-4284-814a-c72e283649dc
md"""
## Defining simulation parameters
"""

# ╔═╡ 285b4e75-6632-4ee8-b578-6d31d6816197
discrete_dynamics = MPC.rk4(dynamics, Ts)

# ╔═╡ e8adaae0-00a5-4ce0-9df8-7c273b8112f4
md"System parameters:"

# ╔═╡ c8185e29-2d11-4514-bebd-6bd9ae327bca
p = sys.p

# ╔═╡ bbc3b765-83a7-41ff-8a9b-731961247760
md"""
# Defining constraints
"""

# ╔═╡ 93d03d47-5cb7-4532-a874-d6b7b042f484
begin
	xmin = [0.1, 0.1, 50, 50]
	xmax = [2, 2, 142, 140]
	umin = [5, -8500]
	umax = [100, 0.0]
	bounds_constraints = BoundsConstraint(; xmin, xmax, umin, umax)
end

# ╔═╡ 3992e177-181b-49a2-85be-d2e4ac048401
md"""
# Defining a cost function
"""

# ╔═╡ 1eb2ba49-64bb-4ac1-bda5-ebb89f86f9fa
begin
	running_cost = StageCost() do si, p, t
    	abs2(si.x[2]-si.r[2])
	end
	
	getter = (si,p,t)->SA[si.u[1], si.u[2]]
	difference_cost = DifferenceCost(getter) do e, p, t
	    5e-6*abs2(e[1]) + 2.5e-9*abs2(e[2]) # Control action penalty on differences
	end
	
	terminal_cost = TerminalCost() do ti, p, t
	    abs2(ti.x[2]-ti.r[2])
	end
	
	objective = Objective(running_cost, difference_cost, terminal_cost)
end

# ╔═╡ b29f2e07-94a0-4321-83ca-3aa36b0cb5ef
md"""
# Providing an initial guess
"""

# ╔═╡ 212c8b5b-503e-4fce-88cb-371506958a8f
begin
	x = repeat(x0, 1, N+1)
	u = randn(nu, N)
	x, u = MPC.rollout(discrete_dynamics, x0, u, p, 0)
	oi = ObjectiveInput(x, u, r)
end;

# ╔═╡ 42f7eeb6-90da-45a3-a750-b987b13cc0c4
md"""
# Defining a solver and state observer
"""

# ╔═╡ 19dad3eb-7e19-4473-8564-0d1d3c15f610
begin
	solver = MPC.IpoptSolver(;
	        verbose                     = false,
	        tol                         = 1e-6,
	        acceptable_tol              = 1e-2,
	        max_iter                    = 500,
	        max_cpu_time                = 20.0,
	        max_wall_time               = 20.0,
	        constr_viol_tol             = 1e-6,
	        acceptable_constr_viol_tol  = 1e-3,
	        acceptable_iter             = 5,
	        exact_hessian               = true,
	        acceptable_obj_change_tol   = 0.01,
	)
	
	observer = StateFeedback(discrete_dynamics, x0)
end;

# ╔═╡ efa63eeb-4f53-48d5-ba0f-7f380cd2a469
md"""
# Defining a discretization
"""

# ╔═╡ afeab9c9-91e7-43dd-8f09-d218dc591e19
disc = CollocationFinE(dynamics; n_colloc=2);

# ╔═╡ 779ae559-4fd3-4e17-8030-146e7311e914
md"""
# Defining the nominal MPC problem
"""

# ╔═╡ f2676539-b288-4329-8f6f-1f6d1cce060e
prob = GenericMPCProblem(
    dynamics;
    N,
    observer,
    objective,
    constraints = [bounds_constraints],
    p,
    Ts,
    objective_input = oi,
    solver,
    xr = r,
    presolve = true,
    scale_x,
    scale_u,
    disc,
    verbose = false,
)

# ╔═╡ d71e93f6-bebb-4573-840c-1231a87ae29a
md"""
## Solving the nominal MPC problem
"""

# ╔═╡ bda08cd5-0d14-4215-9bd3-362e0b4e8c91
begin
history = MPC.solve(prob; x0, T = 50, verbose = false, dyn_actual = discrete_dynamics)
plot(history, layout=(3, 2), sp=[1 2 3 4 1 2 3 4 5 6], title="", xlabel=["" "" "" "" "Time [hrs]" "Time [hrs]"], topmargin=-5Plots.mm)
hline!(xmax[3:4]', ls=:dash, lw=1, color=:black, sp=(3:4)', lab="Upper bound")
end

# ╔═╡ ec1d3ba9-64b0-44f7-82e4-5b4908c96313
md"""
# Introducing uncertainty
5% error in parameter ``E_{A_{ad}}`` (energy released by reaction [kJ/mol])
"""

# ╔═╡ b7ea754b-64be-4a9f-a758-32febf6b68cf
# ╠═╡ skip_as_script = true
#=╠═╡
begin
p_actual = Base.setindex(p, 0.95*p.E_A_ad, :E_A_ad) # Decrease E_A_ad by 5%
history_u = MPC.solve(prob; x0, T = 50, verbose = false, dyn_actual = discrete_dynamics, p_actual);
plot(history_u, layout=(3, 2), sp=[1 2 3 4 1 2 3 4 5 6], title="", xlabel="Time [hrs]", topmargin=-5Plots.mm)
hline!(xmax[3:4]', ls=:dash, lw=1, color=:black, sp=(3:4)', lab="Upper bound")
end
  ╠═╡ =#

# ╔═╡ 1a08bf9e-c985-4498-9bd2-5361cc09fd42
md"""
# Defining a robust MPC problem
- Model a ±6% uncertainty in ``E_{A_{ad}}``
- Specify `robust_horizon = 1` to solve a robust MPC problem
"""

# ╔═╡ 0598acde-2b35-4373-b35f-0f289a4abdd0
# ╠═╡ skip_as_script = true
#=╠═╡
begin
	p_uncertain = MPCParameters.([
		p, # nominal case
		Base.setindex(p, 0.94*p.E_A_ad, :E_A_ad), # 6% lower
		Base.setindex(p, 1.06*p.E_A_ad, :E_A_ad), # 6% higher
	])
	prob_robust = GenericMPCProblem(
		dynamics;
		N,
		observer,
		objective,
		constraints = [bounds_constraints],
		p = p_uncertain,
		Ts,
		objective_input = oi,
		solver,
		xr = r,
		presolve = true,
		scale_x,
		scale_u,
		disc,
		verbose = false,
		robust_horizon = 1, # Indicate that we are designing a robust MPC controller
	)
end
  ╠═╡ =#

# ╔═╡ b379f6d5-3d2e-44cc-b812-54f9bc5a0c62
md"""
## Solving the robust MPC problem
"""

# ╔═╡ e0bfaa2d-8e4b-42f3-918c-8585a321b608
#=╠═╡
begin
	anim = Plots.Animation()
	function callback(actual_x, u, x, X, U)
	    n_robust = length(p_uncertain)
	    (; nx, nu) = dynamics
	    T = length(X)
	    tpast = 1:T
	    fig = plot(
	        tpast,
	        reduce(hcat, X)',
	        c       = 1,
	        layout  = (3,2),
	        sp      = (1:nx)',
	        ylabel  = permutedims(state_names(dynamics)),
	        legend  = true,
	        lab     = "History",
	        xlims   = (1,60),
	        size    = (600, 800),
	    )
	    plot!(
	        tpast,
	        reduce(hcat, U)',
	        c       = 1,
	        sp      = (1:nu)' .+ nx,
	        ylabel  = permutedims(input_names(dynamics)),
	        legend  = true,
	        lab     = "History",
	        xlims   = (1,60),
	    )
	
	    xs = map(1:n_robust) do ri
	        xu, uu = get_xu(prob_robust, ri)
	        xu
	    end
	    Xs = reduce(vcat, xs)
	    tfuture = (1:size(Xs, 2)) .+ (T - 1)
	    lab = ""
	    plot!(tfuture, Xs'; c = (1:n_robust)', l = :dash, sp = (1:nx)', lab)
	
	    us = map(1:n_robust) do ri
	        xu, uu = get_xu(prob_robust, ri)
	        uu
	    end
	    Us = reduce(vcat, us)
	    tfuture = (1:size(Us, 2)) .+ (T - 1)
	    plot!(tfuture, Us'; c = (1:n_robust)', l = :dash, sp = (1:nu)'.+ nx, lab)
	    hline!(xmax[3:4]', l = (:gray, :dash), sp=(3:4)', lab="Upper bound")
	    hline!([r[2]], l = (:green, :dash), lab = "Reference", sp=2)
	    Plots.frame(anim, fig)
	end
	
	history_robust = MPC.solve(prob_robust; x0, T = 50, verbose = false, dyn_actual = discrete_dynamics, p_actual, callback);
	gif(anim, fps = 15)
end
  ╠═╡ =#

# ╔═╡ 4182d108-be64-48ce-9db6-1c90bc72d841
#=╠═╡
begin
	plot(history_robust, layout=(3, 2), sp=[1 2 3 4 1 2 3 4 5 6], title="", xlabel=["" "" "" "" "Time [hrs]" "Time [hrs]"], topmargin=-2Plots.mm)
	hline!(xmax[3:4]', l = (:gray, :dash), lab = "Upper bound", sp=[3 4])
end
  ╠═╡ =#

